# OEIS sequence: A352635

def A352635(n):
    cset, iset = set(), set()
    for i in range(n):
        if i not in iset:
            j, jset, jlist = i, set(), []
            while j not in jset:
                jset.add(j)
                jlist.append(j)
                iset.add(j)
                j = (j**2+1) % n
            cset.add(min(jlist[jlist.index(j):]))
    return len(cset) # _Chai Wah Wu_, Apr 13 2022

